import React from 'react'
import {HiArrowNarrowRight} from 'react-icons/hi';

export const Home = () => {
  return (
    <div name='home' className='w-full h-screen bg-[black] ' >
      <div className='h-full flex  mx-auto px-8 flex-col justify-center text-[#ffffff]'>
          <p>
            Hellow
          </p>
      </div>
    </div>
  )
}
